import React from 'react';
import { Container, Grid, Grow, makeStyles, Toolbar } from '@material-ui/core';
import ClippedDrawer from '../fragment/Header.js';


const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
    },
    content: {
        flexGrow: 1,
        marginTop: 64,
        paddingLeft: 16
    }
}));

function Home() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <ClippedDrawer />
            
            <Container className={classes.content}>
                
                <Grow in>
                    <Grid container justify="space-between" alignItems="stretch" spacing={3} flexGrow>
                        <Grid item xs={12} sm={7}>
                            item
                        </Grid>
                        <Grid item xs={12} sm={7}>
                            item
                        </Grid>
                        <Grid item xs={12} sm={7}>
                            item
                        </Grid>
                        <Grid item xs={12} sm={7}>
                            item
                        </Grid>
                    </Grid>

                </Grow>

            </Container>
        </div>
            
    );
}

export default Home;
